function loadErrorLog(){return requestSpreadsheetData("Logs","Error Log").then(e=>{console.log("ErrorValues: ",e);const t=document.getElementById("error-table-body");let o="",r={},n=e[0];for(let e=0;e<n.length;e++)r[n[e]]=e;for(let t=e.length-1;t>=1;t--){const n=e[t],d=n[r.Time],l=new Date(d).getTime(),a=n[r.Browser];let g;g="TRUE"==n[r["Login Status"]].toUpperCase()?"Logged In":"Not Logged In";const s=n[r.Message],c=n[r.Name];o+=`\n        <tr>\n          <td data-sort="${l}">${d}</td>\n          <td>${a}</td>\n          <td>${g}</td>\n          <td>${s}</td>\n          <td>${c}</td>\n        </tr>\n        `}t.innerHTML=o,$("#error-table").DataTable({order:[[0,"desc"]],pageLength:25}),document.getElementById("table-loading").style.display="none"}).catch(e=>{const t="Unable to display error log: ";console.error(t,e),recordError(e,t)})}function loadSignedIn(){const e=document.getElementById("table-loading");e.style.display="",loadErrorLog()}